import styled from 'styled-components';

function Backdrop({ ...props }) {
	const Backdrop = styled.div`
		background-color: whitesmoke;
		height: 100vh;
		width: 100vw;
	`;

	return <Backdrop>{props.children}</Backdrop>;
}

export default Backdrop;
